import React from "react";
import axios from "axios";
import Nav from "../komponen/Nav";
import {  useForm, SubmitHandler } from "react-hook-form";
import Endpoint from "../config/Endpoint";

export default function  AddJenisProduk() {

    const { register, handleSubmit, watch, formState: { errors } } = useForm();
    const onSubmit = data => {
        axios.post(Endpoint.BASE_URL + `jenis_produk`,  data )
            .then(res => {
                if (res.data.error == false){

                }
            })
    };

    return(
        <div>
            <Nav/>
            <div className="container">
                <div className="container-fluid">

                    <h2>Tambah Jenis Produk</h2>

                    <br/>
                    <form onSubmit={handleSubmit(onSubmit)}>
                        <div className="col-md-12 form-group">
                            <input type="text" {...register("email",{required:true})} className="form-control" name="email"  placeholder="Masukkan email"/>
                        </div>
                        {errors.email && <span>This field is required</span>}
                        <div className="col-md-12 form-group">
                            <input type="password" {...register("password",{required:true})} name="password" placeholder="Masukkan password" className="form-control"/>
                        </div>
                        {errors.password && <span>This field is required</span>}
                        <br/>
                        <center>
                            <div className="col-md-12 form-group">
                                <button className="btn btn-primary" type="submit">Login</button>
                            </div>
                        </center>
                    </form>
                </div>
            </div>
        </div>
    )
}
